import './Expenses.css'
import ExpenseItem from "./ExpenseItem";


function Expenses(itemProps) {
    const expenses = itemProps.items
    
    return (
        <div className="expenses">
            {expenses.map((expense, index) => (
                <ExpenseItem
                    key={index}
                    title={expense.title}
                    price={expense.price}
                    date={expense.date}
                />
            ))}
        </div>
    )
}

export default Expenses
